import { AllPosts } from '../services/AuthService';

export const getAllPosts = (credentials) => (dispatch) => {

	AllPosts(credentials).then(res => {
		console.log(res);

		if(res.posts == "success"){

			dispatch({type: 'SIGNUP_SUCCESS'});
		} else {
			dispatch({type:'SIGNUP_ERROR', res});
		}
	}

	).catch(error => {
		console.log(error)
		dispatch({type:'CODE_ERROR', error})
	});

}
